    "# ===========================\n",
    "# 1. 设置你的 PKL 文件所在文件夹路径\n",
    "# ===========================\n",
    "PKL_FOLDER = r\"D:\\desk\\study5_COPDxLC_SMR\\Aresult_9_1\\ZNEW_SMR_SNP_unit\"  # ← ← ← 修改这一行为你的真实路径\n",
