    "\n",
    "        # ===========================\n",
    "        # 3. 递归结构探测函数\n",
    "        # ===========================\n",
    "        def explore_structure(obj, level=0, max_depth=6, prefix=\"\"):\n",
    "            indent = \"  \" * level\n",
    "            if level > max_depth:\n",
    "                print(f\"{indent}└─ ... (深度限制)\")\n",
    "                return\n",
    "\n",
    "            obj_type = type(obj).__name__\n",
    "\n",
    "            if isinstance(obj, (int, float, str, bool, type(None))):\n",
    "                display_val = repr(obj) if isinstance(obj, str) else str(obj)\n",
    "                if len(display_val) > 50:\n",
    "                    display_val = display_val[:50] + \"...\"\n",
    "                print(f\"{indent}└─ {prefix} {obj_type}: {display_val}\")\n",
    "\n",
    "            elif isinstance(obj, np.ndarray):\n",
    "                print(f\"{indent}└─ {prefix} ndarray {obj.dtype} {obj.shape}\")\n",
    "\n",
    "            elif isinstance(obj, pd.DataFrame):\n",
    "                cols = list(obj.columns)\n",
    "                col_display = cols[:5] + (['...'] if len(cols) > 5 else [])\n",
    "                print(f\"{indent}└─ {prefix} DataFrame {obj.shape} | columns: {col_display}\")\n",
    "\n",
    "            elif isinstance(obj, pd.Series):\n",
    "                print(f\"{indent}└─ {prefix} Series (len={len(obj)}) | name: {obj.name}\")\n",
    "\n",
    "            elif isinstance(obj, dict):\n",
    "                print(f\"{indent}└─ {prefix} dict (共 {len(obj)} 个键)\")\n",
    "                for i, (key, value) in enumerate(obj.items()):\n",
    "                    if i >= 10:\n",
    "                        print(f\"{indent}  └─ ... (还有 {len(obj) - 10} 个键)\")\n",
    "                        break\n",
    "                    key_str = repr(key) if isinstance(key, str) else str(key)\n",
    "                    explore_structure(value, level + 1, max_depth, f\"Key[{key_str}]: \")\n",
    "\n",
    "            elif isinstance(obj, (list, tuple)):\n",
    "                container_name = \"list\" if isinstance(obj, list) else \"tuple\"\n",
    "                print(f\"{indent}└─ {prefix} {container_name} (长度={len(obj)})\")\n",
    "                for i, item in enumerate(obj):\n",
    "                    if i >= 5:\n",
    "                        print(f\"{indent}  └─ ... (还有 {len(obj) - 5} 个项目)\")\n",
